import React from 'react';
import {
  ActivityIndicator,
  StyleSheet,
  Text,
  TouchableOpacity,
} from 'react-native';
import {
  responsiveFontSize,
  responsiveHeight,
  responsiveWidth,
} from 'react-native-responsive-dimensions';
import {AppColor} from '../constants/Colors';

const Button = ({
  title,
  width,
  height,
  onPress,
  color,
  disabled,
  showLoading,
  testID,
  type = 'fill',
}) => {
  return (
    <TouchableOpacity
      style={[
        Styles.container,
        {
          width: width ? width : responsiveWidth(85),
          height: height ? height : responsiveHeight(7),
          opacity: disabled ? 0.5 : 1,
          backgroundColor: color ? color : AppColor.BgColorSecondary,
        },
        type === 'outline' && Styles.containerOutline,
      ]}
      activeOpacity={disabled}
      disabled={disabled}
      onPress={onPress}
      testID={testID}>
      <Text
        style={[
          Styles.textStyle,
          type === 'outline' && Styles.textStyleOutline,
        ]}>
        {title}
      </Text>
      {showLoading && (
        <ActivityIndicator
          size={'small'}
          color={AppColor.PrimaryLight}
          style={{marginLeft: 15}}
        />
      )}
    </TouchableOpacity>
  );
};

const Styles = StyleSheet.create({
  container: {
    borderRadius: responsiveHeight(7),
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: 'row',
  },
  containerOutline: {
    backgroundColor: '#fff',
    borderColor: AppColor.BgColorSecondary,
    borderWidth: 1,
  },
  textStyle: {
    color: '#fff',
    fontFamily: 'Roboto-Medium',
    fontSize: responsiveFontSize(2.2),
  },
  textStyleOutline: {
    color: AppColor.TitleText,
  },
  activityIndicator: {marginLeft: 10},
});

export default Button;

