import React from 'react';
import {StyleSheet, View} from 'react-native';
import {AppColor} from '../constants/Colors';

const Indicator = ({length = 5, active = 0}) => {
  let indicatorArr = [];

  for (let i = 0; i < length; i++) {
    indicatorArr.push(
      <View style={[styles.dotStyle, i <= active && styles.dotActive]} />,
    );
  }

  return <View style={styles.containerStyle}>{indicatorArr}</View>;
};

const styles = StyleSheet.create({
  containerStyle: {flexDirection: 'row'},
  dotStyle: {
    width: 15,
    height: 15,
    backgroundColor: AppColor.BgColorSecondary,
    borderRadius: 8,
    marginHorizontal: 8,
    opacity: 0.2,
  },
  dotActive: {
    opacity: 1,
  },
});

export default Indicator;

