import PushNotification from 'react-native-push-notification';
import PushNotificationIOS from '@react-native-community/push-notification-ios';
import {Linking, Platform} from 'react-native';

/**
 * Push notifications configuration
 */
PushNotification.configure({
  onNotification: function (notification) {
    if (Platform.OS === 'android') {
      if (notification.tag === 'btm') {
        Linking.openURL('passngo://app/my-info');
        PushNotification.cancelLocalNotifications({id: '2'});
      } else if (notification.tag === 'notecheckin') {
        Linking.openURL('passngo://app/site-manager');
        PushNotification.cancelLocalNotifications({id: '1'});
      } else if (notification.tag === 'welcome') {
        Linking.openURL('passngo://app/my-profile/welcome');
        PushNotification.cancelLocalNotifications({id: '3'});
      } else if (notification.tag === 'downloadimage') {
        Linking.openURL(notification.data.uri);
        PushNotification.cancelLocalNotifications({id: '202'});
      } else {
        PushNotification.cancelLocalNotifications({id: '5'});
      }
    } else {
      if (notification.data.id === '2') {
        Linking.openURL('passngo://app/my-info/linkinfo');
        PushNotification.cancelLocalNotifications({id: '2'});
      } else if (notification.data.id === '1') {
        Linking.openURL('passngo://app/site-manager');
        PushNotification.cancelLocalNotifications({id: '1'});
      } else if (notification.data.id === '3') {
        Linking.openURL('passngo://app/my-profile/welcome');
        PushNotification.cancelLocalNotifications({id: '3'});
      } else if (notification.data.id === '202') {
        Linking.openURL(
          notification.data.uri.replace('ph://', 'photos-redirect://'),
        );
        PushNotification.cancelLocalNotifications({id: '202'});
      } else {
        PushNotification.cancelLocalNotifications({id: '5'});
      }
    }

    notification.finish(PushNotificationIOS.FetchResult.NoData);
  },
  popInitialNotification: true,
  requestPermissions: true,
});

/**
 * Create notification channel
 */
PushNotification.createChannel(
  {
    channelId: '8890', // (required)
    channelName: 'Pass&Go', // (required)
    playSound: true, // (optional) default: true
    soundName: 'default', // (optional) See `soundName` parameter of `localNotification` function
    importance: 4, // (optional) default: 4. Int value of the Android notification importance
    vibrate: true, // (optional) default: true. Creates the default vibration patten if true.
  },
  created => {}, // (optional) callback returns whether the channel was created, false means it already existed.
);

/**
 * Local notification creator
 * @param {string} title title of notification
 * @param {string} message message to be diplayed
 * @param {string} tag tag
 * @param {string} info userInfo object
 * @param {string} id id for notification
 */
export const LocalNotification = (
  title,
  message,
  tag,
  info = {},
  id = '101',
) => {
  PushNotification.localNotification({
    id: id,
    channelId: '8890',
    autoCancel: true,
    largeIcon: '',
    bigText: '',
    title: title,
    message: message,
    vibrate: true,
    vibration: 300,
    playSound: true,
    soundName: 'default',
    tag: tag,
    userInfo: info,
  });
};

