import {PostRequest} from '../utils/apiRequests';

export const useSignup = data => {
  const [response, setResponse] = React.useState(null);
  const [error, setError] = React.useState(null);
  const [processing, setProcessing] = React.useState(false);

  React.useEffect(() => {
    _request();
  }, [_request]);

  const _request = useCallback(async () => {
    setProcessing(true);
    await PostRequest(SIGN_UP_URL, data, null, 'multipart/form-data')
      .then(async resp => {
        setResponse(resp);
      })
      .catch(err => {
        setError(err);
      })
      .finally(() => {
        setProcessing(false);
      });
  }, [data]);

  return {response, error, processing};
};

export const useSignin = data => {
  const [response, setResponse] = React.useState(null);
  const [error, setError] = React.useState(null);
  const [processing, setProcessing] = React.useState(false);

  const signin = useCallback(async () => {
    setProcessing(true);
    await PostRequest(SIGN_IN_URL, data)
      .then(async resp => {
        setResponse(resp);
      })
      .catch(err => {
        setError(err);
      })
      .finally(() => {
        setProcessing(false);
      });
  }, [data]);

