  a2a3:
    '法定代理人情報（お名前、性別、生年月日、携帯電話番号、通信サービスプロバイダー、市民/外国人）',
  a2q4: '必須情報とは？',
  a2a4: '本サービスの基本機能を提供するために必要な情報',
  a2q5: 'オプショナル情報とは？',
  a2a5:
    'より専門的なサービスを提供するために収集する必要のある追加情報（オプショナル情報が提供されていない場合でも、本サービスの使用に制限はありません）。',
  a2a6:
    '個人情報は、次の方法で収集されます。\n個人情報を収集する場合、当社はそれについて事前にユーザーに通知し、同意を求めるものとします。\n. ユーザーは、個人情報の収集に同意し、本サービスにサインアップするとき、またはサービスの使用中に関連情報を入力する\n. 個人情報は、提携サービスまたは組織を通じて提供される\n. 個人情報は、カスタマーサービス中にウェブページ、電子メール、ファックス、電話などを介して提供される\n. ユーザーはオンライン/オフラインイベントに参加する\nユーザーが本サービスを利用する際に収集する個人情報は以下のとおりです。\n. デバイス情報（OS、画面サイズ、デバイス ID、デバイスモデル名など）、IPアドレス、クッキー、訪問日、違法使用記録、サービス使用記録など。\n情報は自動的に生成され、収集される場合があります。個人情報は、パートナーシップまたは関連サービスを通じて第三者から提供されます。',

  q3: '3. 個人情報の利用',
  a3:
    '個人情報は、メンバーシップの管理、サービスの提供と改善、および新しいサービスの開発に使用されます。\n個人情報は、ユーザーがサービスにサインアップするとき、またはユーザーがサービスを使用するときに、ホームページ、個々のアプリおよびプログラムなどを通じて、サービスを提供するために必要な最小限の範囲で収集されるものとします。\n- メンバーの識別、ユーザーの登録意志の確認、ユーザーおよび年齢の確認、不適切な使用の防止\n- 14歳未満の子供の個人情報を収集する場合の法定代理人の同意の確認、その後の法定代理人の身元の確認\n- ユーザーの検索と登録、新サービスの開発、さまざまなサービスの提供、問い合わせと苦情の処理、通知の配信などのさまざまな機能の提供\n- 有料サービスの利用者へのコンテンツ等の送付、発送/支払い\n- 本サービスの通常のサービス運用を妨害する行為の防止と制裁（アカウントの盗難や不正使用などを含む）\n- 人口統計学的特性とユーザーの興味、好み、傾向の分析に基づいて、カスタマイズされたコンテンツの推奨とマーケティングの提供\n- 本サービスの使用記録、訪問の頻度とサービスの使用に基づく統計、プライバシーを保護するためのサービス環境の開発、カスタマイズされたサービスの開発、サービスの改善。',

  q4: '4. 個人情報の提供',
  a4:
    '当社は、ユーザーの同意なしに、または適用される法律や規制によって要求されない限り、個人情報を第三者に提供しないものとします。\n当社は、カカオ社のサービスを第三者のサービスにつなげるために、以下の個人情報を第三者に委託するものとします。\n当社は、ユーザーの事前の同意なしに、ユーザーの個人情報を第三者に開示することはありません。ただし、ユーザーが当社のパートナー会社のサービスを利用するために必要な範囲内で、ユーザーの同意を得て第三者に提供する場合があります。\n当社は、サービス提供に必要な業務の一部を委託する過程で、個人情報を第三者に提供します。当社はまた、適用される法律および規制の違反を防ぐために、委託された当事者を監督および監視するものとします。',

  q5: '5. 個人情報の破棄',
  a5:
    'ユーザーの個人情報は、個人情報の収集および利用の目的が達成された時点で直ちに破棄されるものとします。破棄の手順および方法は以下のとおりです。\n電子ファイル形式で保存された個人情報は、情報を復元不能にする技術的手段を使用して削除されます。紙上の記録、印刷物、および文書に印刷された個人情報は、シュレッダーまたは焼却により破壊されます。\nただし、以下の個人情報は、社内の方針により一定期間保管された後、破棄されるものとします。\n以下の情報は、ユーザーがサービスを終了した日から1年間保持された後、破棄されます。\n暗号化されたPCL FREE PASSアカウントと、通知を送信し、終了後のカスタマーサービスの問い合わせを処理するためのSMSが送信された携帯電話番号。\n不適切な使用記録\n\nまた、当社は、個人情報の有効期限に応じて、本サービスを1年間使用しなかった会員の個人情報を個別に保存または削除します。保存された情報は、4年間保管された後に破棄されます。\nこれに加えて、法律およびそれぞれの規定によって保持する必要のあるその他の個人情報を保管するものとします。',

  a6:
    '当社はユーザーの権利を保護するものとします。\nユーザーはいつでも（14歳以下のユーザーは法定代理人を通じて）個人情報を表示および編集することができ、いつでも個人情報の提供に関する同意を取り消すか、サービスを取り消すことができます。ユーザーは、サービスの撤回またはサービスの撤回ボタンをクリックして個人情報の提供を撤回するか、書面、電話、または電子メールでカスタマーサービスに連絡することができます。ユーザーが個人情報の改訂を要求した場合、そのユーザーの情報は、改訂が完了するまで使用または提供されません。\n\n当社はまた、イベントや広告などのマーケティングを提供するために個人情報を使用し、事前にユーザーの同意を求める場合があります。ユーザーはいつでも同意を取り消すことができます。\n上記に関連するリクエストは、ユーザーが書面、電話、または電子メールでカスタマーサービスに連絡すれば、遅滞なく対応できます。\n個人情報のエラーを訂正することをご希望の場合、当社は訂正が完了するまで、個人情報を使用または提供しないものとします。\n\nプライバシー保護に関する質問\n\n本サービスの利用中に発生する個人情報保護に関するお問い合わせ、苦情、フィードバック等については、プライバシー保護責任者または担当部署までご連絡ください。\n当社は、いつもあなたの声に耳を傾け、ご不明な点があれば迅速に回答できるよう最善を尽くします。',
  a7:
    'οRepresentative for managing personal information\n- Department : Business Strategy Group\n- Designation :  CFO \n- Name : Kim InKyu\n- email : pclchip@pclchip.com',
  a8:
    'プライバシーポリシーの修正\n本プライバシーポリシーは、法律またはサービスの変更を反映するように修正される場合があります。\n本プライバシーポリシーが変更された場合、当社は事前にその修正について通知し、修正されたプライバシーポリシーは修正通知の7日後に有効になります。\nただし、収集する個人情報および収集目的を含む利用者の権利に重大な変更があった場合は、少なくとも30日前までに通知するものとします。',
