import SetPassword from '../screens/auth/setPassword';
import SetImage from '../screens/auth/setImage';
import ConfirmImage from '../screens/auth/confirmImage';
import Success from '../screens/auth/success';
import TermsAndConditions from '../screens/authenticated/termsAndConditions';

const Stack = createStackNavigator();

/**
 * This component holds stack navigator for authentication flow
 * @returns Stack.Navigator for authentication flow
 */
const Auth = () => {
  return (
    <Stack.Navigator screenOptions={{headerShown: false}}>
      <Stack.Screen name={SIGN_IN} component={SignIn} />
      <Stack.Screen name={SIGN_UP} component={SignUp} />
      <Stack.Screen name={TERMS_CONDITIONS} component={TermsAndConditions} />
      <Stack.Screen name={SET_PASSWORD} component={SetPassword} />
      <Stack.Screen name={SET_IMAGE} component={SetImage} />
      <Stack.Screen name={CONFIRM_IMAGE} component={ConfirmImage} />
      <Stack.Screen name={SUCCESS} component={Success} />
    </Stack.Navigator>
  );
};
export default Auth;

