import React, {useState} from 'react';
import {
  SafeAreaView,
  StatusBar,
  StyleSheet,
  Text,
  View,
  TextInput,
} from 'react-native';
import {useTranslation} from 'react-i18next';
import {
  responsiveWidth,
  responsiveHeight,
  responsiveFontSize,
} from 'react-native-responsive-dimensions';
import Button from '../../../components/Button';
import Separator from '../../../components/Separator';
import {AppColor} from '../../../constants/Colors';
import {VERIFY_OTP} from '../../../constants/Routes';
import {PostRequest} from '../../../utils/apiRequests';
import {FORGOT_PASSWORD_URL} from '../../../constants/ApiRoutes';
import Snackbar from 'react-native-snackbar';
import Headerlight from '../../../components/Headerlight';

/**
 * this functional component is for forget password
 * in case user have forgot his password
 * this component is not valid for current version
 * @param {object} param0 props
 * @returns component for forget password
 */
const ForgotPassword = ({navigation}) => {
  const {t} = useTranslation('en');
  const [phone, setPhone] = useState('');
  const [processing, setProcessing] = useState(false);

  /**
   * Request send to forget password
   */
  const SendRequest = async () => {
    let pattern = '\\d{2}\\d{10}';
    if (phone.trim().length === 0) {
      showSnackBar(t('forgotPassword.enterNumber'));
      return;
    }
    if (phone.match(pattern)) {
      setProcessing(true);
      const data = {
        phone,
      };
      await PostRequest(FORGOT_PASSWORD_URL, data)
        .then(response => {
          if (response.status === 200) {
            showSnackBar(t('forgotPassword.codeSent'));
            navigation.navigate(VERIFY_OTP, {
              code: response.data.code,
              phone: phone,
            });
          }
        })
        .catch(error => {
          if (error.response.status === 400) {
            if (
              error.response.data.message ===
              'Your phone number is not registered'
            ) {
              showSnackBar(t('forgotPassword.numberNotRegister'));
            }
          } else {
            showSnackBar(t('forgotPassword.unknownError'));
          }
        })
        .finally(() => {
          setProcessing(false);
        });
    } else {
      showSnackBar(t('forgotPassword.enterNumber'));
    }
  };

  /**
   * This method validates the given phone number
   */
  const checkNumber = async () => {
    let pattern = '\\d{2}\\d{10}';
    if (!phone.match(pattern) && phone) {
      showSnackBar(t('common.enterNumber'));
      return;
    }
  };

  /**
   * Shows snackbar
   * @param {string} message
   */
  const showSnackBar = message => {
    Snackbar.show({
      text: message,
      backgroundColor: AppColor.BgColorSecondary,
      textColor: AppColor.PrimaryLight,
      duration: Snackbar.LENGTH_SHORT,
    });
  };
  return (
    <SafeAreaView style={styles.safeAreaView}>
      <View style={styles.container}>
        <StatusBar
          barStyle={'dark-content'}
          backgroundColor={AppColor.Secondary}
        />
        <Headerlight
          navigation={navigation}
          title={t('forgotPassword.title')}
          color={AppColor.TextColorLight}
        />
        <View style={{flexDirection: 'row'}}>
          <Text style={styles.dontHav}>{t('forgotPassword.terms')}</Text>
        </View>
        <Separator height={responsiveHeight(12)} />
        <View style={styles.inputView}>
          <TextInput
            keyboardType={'phone-pad'}
            style={styles.input}
            placeholder={t('forgotPassword.number')}
            placeholderTextColor={AppColor.TextColorLight}
            onChangeText={text => setPhone(text)}
            onBlur={() => checkNumber()}
          />
        </View>
        <Separator height={responsiveHeight(2)} />
        <Button
          title={t('forgotPassword.sendCode')}
          onPress={() => SendRequest()}
          showLoading={processing}
          disabled={processing}
        />
        <Separator height={responsiveHeight(2)} />
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  safeAreaView: {
    flex: 1,
    backgroundColor: '#fff',
  },
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputView: {
    height: responsiveHeight(7),
