import React, {useEffect, useRef, useState} from 'react';
import {
  SafeAreaView,
  StatusBar,
  StyleSheet,
  Text,
  View,
  TextInput,
} from 'react-native';
import {useTranslation} from 'react-i18next';
import {
  responsiveWidth,
  responsiveHeight,
  responsiveFontSize,
} from 'react-native-responsive-dimensions';
import Button from '../../../components/Button';
import Separator from '../../../components/Separator';
import {AppColor} from '../../../constants/Colors';
import {SET_IMAGE} from '../../../constants/Routes';
import {Logo} from '../../../constants/Images';
import Phone from '../../../assets/images/instructionsResults/success.svg';
import {KeyboardAwareScrollView} from 'react-native-keyboard-aware-scrollview';
import Toast from '../../../components/Toast';

/**
 * this functional component is for set password
 * @param {object} param0 props
 * @returns component for set password
 */
const SetPassword = ({route, navigation}) => {
  const inputRef1 = useRef(null);
  const inputRef2 = useRef(null);
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [validated, setvalidated] = useState(false);
  const [showPass, setShowPass] = useState(true);
  const [showConfirmPass, setShowConfirmPass] = useState(true);

  const {t} = useTranslation('en');

  useEffect(() => {
    inputRef1.current.setNativeProps({style: {fontFamily: 'Roboto-Regular'}});
    inputRef2.current.setNativeProps({style: {fontFamily: 'Roboto-Regular'}});
  }, [showPass, showConfirmPass]);

  /**
   * check if password and confirm password is provided
   * @param {string} pass password
   * @param {string} cPassword confirm password
   */
  const validateInput = (pass, cPassword) => {
    if (pass && cPassword) {
      setvalidated(true);
    } else {
      setvalidated(false);
    }
  };

  /**
   * Check input password for validation
   * @returns null
   */
  const checkPassword = () => {
    var passw = /^(?=.*?[A-Z])(?=.*?[a-z])(?=.*?[#?!@$%^&*-]).{8,}$/;

    var format = /[!@#$%^&*()_+\-=\[\]{};':"\\|,.<>\/?]+/;
    if (password.length < 8 && password) {
      Toast(t('changePassword.lessThan8'), 'error');
      return;
    }
    if (!format.test(password) && password) {
      Toast(t('changePassword.specialChar'), 'error');
      return;
    }
    if (confirmPassword.length < 8 && confirmPassword) {
      Toast(t('changePassword.lessThan8'), 'error');
      return;
    }
    if (!format.test(confirmPassword) && confirmPassword) {
      Toast(t('changePassword.specialChar'), 'error');
      return;
    }

    if (!password.match(passw) && password.length > 0) {
      Toast(t('changePassword.uperLowerLetters'), 'error');
    } else {
      if (!confirmPassword.match(passw) && confirmPassword.length > 0) {
        Toast(t('changePassword.uperLowerLetters'), 'error');
      } else {
        if (password && confirmPassword) {
          if (password === confirmPassword) {
            navigation.navigate(SET_IMAGE, {
              obj: {...route.params.obj, password: password},
            });
          } else {
            Toast(t('changePassword.notSame'), 'error');
          }
        }
      }
    }
  };

  return (
    <SafeAreaView style={styles.safeAreaView}>
      <StatusBar
        barStyle={'dark-content'}
        backgroundColor={AppColor.Secondary}
      />
      <View style={styles.container}>
        <KeyboardAwareScrollView
          showsVerticalScrollIndicator={false}
          contentContainerStyle={styles.scrollView}>
          <View style={{position: 'absolute', top: responsiveHeight(4)}}>
            <Logo height={62} width={62} fill={AppColor.BgColorSecondary} />
          </View>
          <Separator height={responsiveHeight(15)} />
          <Phone
            height={responsiveHeight(25)}
            width={responsiveHeight(25)}
            fill={AppColor.BgColorSecondary}
          />
          <Text style={styles.note}>{t('signup.setPassNote')}</Text>
          <View style={styles.inputView}>
            <TextInput
              ref={inputRef1}
              testID={'validatePass'}
              value={password}
              style={[styles.input, {width: responsiveWidth(75)}]}
              onChangeText={val => {
                setPassword(val);
                validateInput(val, confirmPassword);
              }}
              placeholder={t('changePassword.newPass')}
              placeholderTextColor={AppColor.TextColorLight3}
              secureTextEntry={showPass ? true : false}
              contextMenuHidden={true}
            />
          </View>
          <Text style={styles.terms}>{t('changePassword.terms')}</Text>
          <View style={styles.inputView}>
            <TextInput
              ref={inputRef2}
              value={confirmPassword}
              testID={'validate'}
              style={[styles.input, {width: responsiveWidth(75)}]}
              onChangeText={val => {
                setConfirmPassword(val);
                validateInput(password, val);
              }}
              placeholder={t('changePassword.confirmPass')}
              placeholderTextColor={AppColor.TextColorLight3}
              secureTextEntry={showConfirmPass ? true : false}
              contextMenuHidden={true}
            />
          </View>
          <Separator height={15} />
          <Button
            testID={'confirmBtn'}
            onPress={() => checkPassword()}
            title={t('buttons.next')}
            disabled={!validated}
          />
          <Separator height={15} />
        </KeyboardAwareScrollView>
      </View>
    </SafeAreaView>
  );
};

