import React, {useLayoutEffect, useState} from 'react';
import {
  ActivityIndicator,
  SafeAreaView,
  StyleSheet,
  Text,
  View,
} from 'react-native';
import {useTranslation} from 'react-i18next';
import {
  responsiveWidth,
  responsiveHeight,
  responsiveFontSize,
} from 'react-native-responsive-dimensions';
import Button from '../../../../../components/Button';
import Separator from '../../../../../components/Separator';
import {AppColor} from '../../../../../constants/Colors';
import {navigationOptionsWithLogo} from '../../../../../config/navigationOptions';
import {STStep4} from '../../../../../constants/Images';
import {ST_CONFIRM_TEST} from '../../../../../constants/Routes';
import ImageCropPicker from 'react-native-image-crop-picker';

/**
 * this functional component is for take photo for self test
 * @param {object} param0 navigation and route props
 * @returns component
 */
const STTakePhoto = ({route, navigation}) => {
  const {t} = useTranslation('en');

  const {qrData, video} = route.params;
  const [takingPhoto, setTakingPhoto] = useState(false);

  useLayoutEffect(() => {
    navigation.setOptions(navigationOptionsWithLogo);
  });

  /**
   * Take photo from camera
   */
  const takeImage = async () => {
    setTakingPhoto(true);
    await ImageCropPicker.openCamera({
      width: 300,
      height: 400,
      useFrontCamera: false,
    })
      .then(image => {
        navigation.navigate(ST_CONFIRM_TEST, {
          photo: image.path,
          qrData,
          video,
        });
      })
      .finally(() => {
        setTimeout(() => {
          setTakingPhoto(false);
        }, 200);
      });
  };

  if (takingPhoto) {
    return (
      <SafeAreaView style={styles.safeAreaView}>
        <View style={[styles.container, {backgroundColor: '#fff'}]}>
          <ActivityIndicator size={'large'} color={AppColor.BgColorSecondary} />
        </View>
      </SafeAreaView>
    );
  }

  return (
    <SafeAreaView style={styles.safeAreaView}>
      <View style={styles.container}>
        <STStep4
          height={responsiveHeight(28)}
          width={responsiveHeight(28)}
          fill={AppColor.BgColorSecondary}
        />
        <Text style={styles.note}>{t('results.takePhotoNoteST')}</Text>

        <Separator height={responsiveHeight(1)} />
        <Button
          testID="pickImage"
          onPress={() => takeImage()}
          title={t('buttons.takePhoto')}
        />
        <Separator height={responsiveHeight(4)} />
      </View>
    </SafeAreaView>
  );
};

/**
 * StyleSheet
 */
const styles = StyleSheet.create({
  safeAreaView: {
    flex: 1,
    backgroundColor: '#fff',
  },
  container: {
    flex: 1,
    backgroundColor: '#fff',
