import AsyncStorage from '@react-native-async-storage/async-storage';

/**
 * This method is used to store data in async storage
 * @param {String} key Unique key for identifying data stored in async storage
 * @param {String} data Data to be stored
 */
export const saveData = async (key, data) => {
  AsyncStorage.setItem(key, data);
};

/**
 * This method is used get data from async storage
 * @param {String} key Unique key for identifying data stored in async storage
 * @returns Value obtained from async storage against given key
 */
export const getData = async key => {
  const value = await AsyncStorage.getItem(key);
  return value;
};

/**
 * This method is used remove data from async storage
 * @param {string} key Unique key for identifying data stored in async storage
 */
export const removeData = async key => {
  const value = await AsyncStorage.removeItem(key);
};

